# Load image packagepkg load imageclose all  % figures windowsclc % command windowclear % variables in memory# Read imageimg_org = imread("/Users/ASamir/third_year/Picture2.png");# convert to greyscaleimg = rgb2gray(img_org);# Change to doubleimg = double(img);# Apply Contrast Enchancement.[img_1] = GmmCor(img, 1, 3);[img_2] = GmmCor(img, 1, 0.5);#Change to uint8#img_1 = uint8(img_1);#img_2 = uint8(img_2);#img_org = uint8(img_org);# Show different imagesfigure();subplot(3,1, 1);imshow(img_org, []);subplot(3,1, 2);imshow(img_1, []);subplot(3,1, 3);imshow(img_2, []);